import React from 'react';
import "./menu.css"

const Menu = () => {
    return (
        <nav>
            <ul className='menu'>
                <li>Home</li>
                <li>UserList</li>
                <li>Blog Post</li>
                <li>Login</li>
                <li>Sign Up</li>
                <li>Contact</li>
            </ul>
        </nav>
    );
}

export default Menu;
